import React from "react";
import './Profile.css'
import profilePic from './profile.jpg';
import { useLocation } from "react-router-dom";
const Profile = (props) => {
    return (<div className="container-profile">
        {/* <img src={profilePic} alt="profile-pic" className="profile-pic"/> */}
        
        {  !props.address?
                <div className="info">
                    <h2>{props.name}</h2>
                    <h2>{props.email}</h2>
                    <h2>{props.gender}</h2>
                </div>        
        :       
                <div className="info">
                    <h2 className="address-profile">{props.cityName}</h2>
                    <h2 className="address-profile">{props.society}</h2>
                    <h2 className="address-profile-low">{props.residationType}</h2>
                    {props.btn? <button className="btn-profile" onClick={props.clicked} >+</button>:""}  
                </div>
        }

    </div>)
}
export default Profile
